      out.write("\t\t\tsaleday = parseInt(saleday);\r\n");
      out.write("\t\t\tcostrent = parseInt(costrent);\r\n");
      out.write("\t\t\tif(isNaN(costrent)){\r\n");
      out.write("\t\t\t\tcostrent = 0;\r\n");
      out.write("\t\t\t}\r\n");
      out.write("\t\t\t//alert(\"日租金=\"+day_rent+\"实际-预计天数=\"+date_diffrcpt+\"实际出行天数=\"+daycounts);\r\n");
      out.write("\t\t\tvar simcost = day_rent*daycounts;\r\n");
      out.write("\t\t\tif(isNaN(simcost)){\r\n");
      out.write("\t\t\t\t$(\"#3g_cost\").val(0);\r\n");
      out.write("\t\t\t}else{\r\n");
      out.write("\t\t\t\t$(\"#3g_cost\").val(simcost);\r\n");
      out.write("\t\t\t}\r\n");
      out.write("\t\t\tvar fdate = $(\"#fdates\").val();\r\n");
      out.write("\t\t\tfdate = parseInt(fdate);\r\n");
      out.write("\t\t\t//alert(fdate);\r\n");
      out.write("\t\t\tif(daycounts<saleday){\r\n");
      out.write("\t\t\t\tfdate = Math.round(fdate)-1+saleday;\r\n");
      out.write("\t\t\t}else{\r\n");
      out.write("\t\t\t\tfdate = date_diffrcpt;\r\n");
      out.write("\t\t\t}\r\n");
      out.write("\t\t\t//alert(date_diffrcpt);\r\n");
