      out.write("\t\t\t//退租金额=押金-fdate*日租金+优惠金额\r\n");
      out.write("\t\t\tvar cost_return_discount = cost_return-costli+costrent;\r\n");
      out.write("\t\t\t//alert(cost_return_discount);\r\n");
      out.write("\t\t\t//alert(\"退租金额=\"+cost_return_discount);\r\n");
