      out.write("<script language=\"javascript\" type=\"text/javascript\">  \r\n");
      out.write("\t\t   \r\n");
      out.write("\t\t/*     \r\n");
      out.write("\t\t * 对Date的扩展，将 Date 转化为指定格式的String     \r\n");
      out.write("\t\t * 月(M)、日(d)、12小时(h)、24小时(H)、分(m)、秒(s)、周(E)、季度(q) 可以用 1-2 个占位符     \r\n");
      out.write("\t\t * 年(y)可以用 1-4 个占位符，毫秒(S)只能用 1 个占位符(是 1-3 位的数字)     \r\n");
      out.write("\t\t * eg:     \r\n");
      out.write("\t\t * (new Date()).pattern(\"yyyy-MM-dd hh:mm:ss.S\") ==> 2006-07-02 08:09:04.423     \r\n");
      out.write("\t\t * (new Date()).pattern(\"yyyy-MM-dd E HH:mm:ss\") ==> 2009-03-10 二 20:09:04     \r\n");
